import React from 'react'
import TextField from '@material-ui/core/TextField'

function Contacts () {
    const [state, setState] = React.useState({
        Prenom: '',
        Nom: '',
        Email: '',
        Tel: ''
    })

    const onChangeInput = (e) => {
        setState(Object.assign({}, state, { [e.target.name]: e.target.value }))
    }

    return (
        <>
            <h1>Qui demande cette formation ?</h1>
            <TextField
                label="Prénom*"
                value={state.Prenom}
                onChange={onChangeInput}
                variant="outlined"
                margin="dense"
                name="Prenom"
            />
            <TextField
                label="Nom*"
                value={state.Nom}
                onChange={onChangeInput}
                margin="dense"
                variant="outlined"
                name="Nom"
            />
            <TextField
                label="Email*"
                value={state.Email}
                onChange={onChangeInput}
                margin="dense"
                variant="outlined"
                name="Email"
            />
            <TextField
                label="Téléphone*"
                value={state.Tel}
                onChange={onChangeInput}
                margin="dense"
                variant="outlined"
                name="Tel"
            />
        </>
    )
}

export default Contacts
